function Blog_main() {
  function Blog_main({ blog }) {
    // Проверяем, что объект blog существует, прежде чем пытаться получить доступ к его свойствам
    if (!blog) {
      return null; // Или любой другой компонент/элемент, который вы хотите отобразить в случае отсутствия блога
    }
    return (
      <section className="blog">
        <div className="blog-header">
          <img className="ava" src="/img/logo.jpeg" alt="Blogger Avatar" />
          <h4 className="blog-name">Danial Abibulla</h4>
          <button className="delete">
            <img src="/img/delete.png" alt="Delete Blog" />
          </button>
        </div>
        <div className="blog-content">
          <p>aaa</p>
          <img className="blog-img" src="/img/111.jpg" alt="Blog Image" />
        </div>
        <div className="buttons">
          <button>
          <img src="/img/like.png" alt="Like" />
          </button>
          <button>
            <img src="/img/dislike.png" alt="Dislike" />
          </button>
          <button>
            <img src="/img/save.png" alt="Save" />
          </button>
        </div>
      </section>
    );
  }
}
  export default Blog_main;
